	add("quiddity", "{\"term\":\"quiddity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027quiddité\u0027 and its source, \u0027quidditas\u0027 from Latin \u0027quid\u0027 + \u0027-itas\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The essence or inherent nature of a person or thing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1822\u0027\u0027, October, \u0027The Old Actors\u0027, published in \u0027London Magazine\u0027, section on “Mr. Munden” ([http://www.gutenberg.org/ebooks/10343 ebook\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A tub of butter, contemplated by him, amounts to a Platonic idea. He understands a leg of mutton in its \u0027\u0027quiddity\u0027\u0027. He stands wondering, amid the commonplace materials of life, like primæval man, with the sun and stars about him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1962\u0027\u0027, \u0027Pale Fire\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"My vision reeked with truth. It had the tone\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027quiddity\u0027\u0027 and quaintness of its ow\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Reality\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, \u0027Livia\u0027, Faber \u0026amp; Faber 1992 (\u0027Avignon Quintet\u0027), p. 352\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"He represented my \u0027\u0027quiddity\u0027\u0027 I suppose – the part which, thanks to you, has converted a black pessimism about life into a belief in cosmic absurdity\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A trifle; a nicety or quibble\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An eccentricity; an odd feature\", \"priority\":11}]}, \"synonyms\":{}}");

	add("quidlet", "{\"term\":\"quidlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quid|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"quid; pound in mone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1935\u0027\u0027, George Goodchild, Carl Eric Bechhofer Roberts, \u0027They all do it!: and two other plays\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"All we want to see is that our three hundred \u0027\u0027quidlets\u0027\u0027 are sitting comfy in the bank\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1939\u0027\u0027, \u0027The Strand magazine\u0027 (volume 97‎\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Say he had lost five thousand \u0027\u0027quidlets\u0027\u0027. And what about it? What were five thousand paper quidlets to him\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, Bruce Marshall, \u0027The black oxen\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Two-fifty \u0027\u0027quidlets\u0027\u0027, Mr. Duncan — you can\u0027t get a really posh stone for less. In any case it wouldn\u0027t be only an emerald or a sapphire you\u0027d be buying\", \"priority\":7}]}, \"synonyms\":{}}");

	add("quidnunc", "{\"term\":\"quidnunc\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0026quot;\u0027quid\u0027 \u0027nunc\u0027 \u0026quot;, \u0027What now?\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person eager to learn news and scandal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quiescence", "{\"term\":\"quiescence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being quiescent; dormancy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Being at rest, quiet, still, inactive or motionless\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The action of bringing something to rest or making it quiescent; the action of coming to rest or to a quiescent state\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1662\u0027\u0027 Thomas Salusbury, \u0027Galileo\u0027s Dialogue Concerning the Two Chief World Systems\u0027, Dialogue 2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I pray you, Salviatus, to tell me ... the cause of the Pendulum\u0027s quiescence\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The period when a cell is in a term of no growth and no division\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In insects, a temporary slowing down of metabolism and development in response to adverse environmental conditions, which, unlike diapause, does not involve physiological changes\", \"priority\":7}]}, \"synonyms\":{}}");

	add("quietism", "{\"term\":\"quietism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quiet|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of mysticism involving quiet contemplation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A state of passive quietness\", \"priority\":2}]}, \"synonyms\":{}}");

