	add("quilt", "{\"term\":\"quilt\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027quilte\u0027 from Old french (842-ca. 1400) \u0027cuilte\u0027 \u0027coute\u0027 (compare French \u0027couette\u0027 , from Latin \u0027culcita\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bed covering consisting of two layers of fabric stitched together, with insulation between, often having a decorative design\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"My grandmother is going to sew a \u0027\u0027quilt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A quilted skirt worn by women. \u0026lt;!--Webster 1913--\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

	add("quillback", "{\"term\":\"quillback\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|quill|back|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a freshwater fish of the sucker family with a long filament that extends back from the dorsal fin, native to the eastern and central United States\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quiller", "{\"term\":\"quiller\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quill|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who creates decorative designs from thin strips of curled paper\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Malinda Johnston, \u0027Paper quilling: beautiful paper filigree to make in a weekend\u0027 (page 6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Some \u0027\u0027quillers\u0027\u0027 make small wooden stands resembling trees, with horizontal \u0026quot;branches\u0026quot; over which they hang the strips\", \"priority\":3}]}, \"synonyms\":{}}");

