	add("quine", "{\"term\":\"quine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{named-after|occ\u003dphilosopher and logician|Willard Van Orman Quine|wplink\u003d\u003d|lang\u003den}}. Senses related to self-reference are derived from w:Douglas Hofstadter|Douglas Hofstadter\u0027s \u0027w:Gödel, Escher, Bach|Gödel, Escher, Bach\u0027 (referencing the w:Quine\u0027s paradox|paradox named after him), while the verb sense of \u0026quot;to deny the importance or significance of something\u0026quot; was independently coined by w:Daniel Dennett|Daniel Dennett in \u0027w:The Philosophical Lexicon|The Philosophical Lexicon\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A program that produces its own source code as output\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, John David Regehr, \u0027[//groups.google.com/d/msg/comp.lang.misc/-dR-TMoB3S4/CMfGrs1MzwQJ a quine in C++?]\u0027, comp.lang.misc, Usene\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This has been bugging me recently. Any \u0027\u0027quines\u0027\u0027 or pointers to relevant articles or web pages is appreciated. Thanks\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Gergo Barany, \u0027[//groups.google.com/d/msg/comp.lang.c/EHioEFXMN_A/4BtmxcV_dlAJ Re: CC hack?]\u0027, comp.lang.c, Usene\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There was also a quine thread here in comp.lang.c just days ago, search deja.com (the thread\u0027s title was something about self-printing programs, I think\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Clinton Pierce, \u0027Perl Developer\u0027s Dictionary\u0027, Sams Publishing (ISBN 9780672320675), page 26\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Most \u0027\u0027quines\u0027\u0027 are notoriously difficult (and fiendish) to write. Perl can cheat, though\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Arthur J. O\u0027Dwyer, \u0027[//groups.google.com/d/msg/comp.lang.c/mERds_qS6wg/vYrezr0rWqoJ Re: \u0026quot;A to Z of C\u0026quot;]\u0027, comp.lang.c, Usene\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Why have a one-page chapter that doesn\u0027t say anything? At the least, you should present a quine program written in pure ISO C (I can send you one if you like\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, David Darling, \u0027The Universal Book of Mathematics: From Abracadabra to Zeno\u0027s Paradoxes\u0027, John Wiley \u0026amp; Sons (ISBN 9780471667001), page 26\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Although writing a \u0027\u0027quine\u0027\u0027 is not always easy, and in fact may seem impossible, it can always be done in any programming language that is Turing complete (see Turing machine), which includes every programming language actually in use\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Simon Cozens, \u0027Advanced Perl Programming\u0027, O\u0027Reilly Media (ISBN 9781449378912), page 26\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"SelfGOL can reproduce itself; it can turn other programs into a \u0027\u0027quine\u0027\u0027; it can display a scrolling banner; it plays the Game of Life; and it contains no (ordinary) loops, goto statements, or if statements. Control flow is done, well, interestingly\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Uwe Seifert, Jin-hyun Kim, Anthony Moore, \u0027Paradoxes of Interactivity: Perspectives for Media Theory, Human-computer Interaction, and Artistic Investigations\u0027, transcript Verlag (ISBN 9783899428421), page 17\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Yet from a different perspective, it describes the process of producing this very code; in other words, it is because object- and meta-language interrelate that makes a \u0027\u0027quine\u0027\u0027 difficult; in less reflective programs, where means and ends are more separate, this difficulty is not so obvious\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Mike Ash, [//groups.google.com/d/msg/rec.arts.sf.written/tN-qCzPjCAE/7Uowd0MXCmUJ Re: 406 Not Acceptable (was Re: \u0026quot;--All You Zombies--\u0026quot; title)], rec.arts.sf.written, Usene\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Gee, last time I wrote a \u0027\u0027quine\u0027\u0027 in Lisp it ended up being kind of difficult\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Antoine Amarilli et al., \u0026quot;Can Code Polymorphism Limit Information Leakage?\u0026quot;, \u0027Information Security Theory and Practice: Security and Privacy of Mobile Devices in Wireless Communication\u0027 (edited by Claudio Agostino Ardagna, Jianying Zhou), Springer (ISBN 9783642210396), page 1\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The solution is to make a \u0027\u0027quine\u0027\u0027 that is also a λ-expression (instead of a list of statements). This is possible, thanks to S-expressions. The way the \u0027\u0027quine\u0027\u0027 works relies on the fact that its code is a list of statements and that the last one can take a list of the previous ones as arguments\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Pietro Liò, Dinesh Verma, \u0027Biologically Inspired Networking and Sensing: Algorithms and Architectures\u0027, IGI Global Snippet (ISBN 9781613500934\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Quines\u0027\u0027 exist for any programming language that is Turing complete and it is a common challenge for students to come up with a \u0027\u0027Quine\u0027\u0027 in their language of choice. The \u0027\u0027Quine\u0027\u0027 Page provides a comprehensive list of such programs in various languages\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Brian, \u0027[//groups.google.com/d/msg/talk.religion.buddhism/Denn9TZywdo/edWL0Sat5cwJ Re: \u0026quot;Mountains will be Mountains\u0026quot;]\u0027, talk.religion.buddhism, Usene\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Upon receiving a \u0026quot;QUINE\u0026quot; request by the client, the server will first send a 01 OK response, and will then provide the client with a \u0027\u0027quine\u0027\u0027 in the programming language used to implement the server\", \"priority\":23}]}, \"synonyms\":{}}");

	add("quint", "{\"term\":\"quint\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027quint\u0027 from Latin \u0027quintus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an interval of one fift\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"in piquet\u0027) a sequence of five playing cards of the same suit; equivalent to a straight flush in poke\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a quin or quintuple\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A vehicle used by firefighters that combines the capabilities of a fire engine and a fire truck, having the ability to provide vertical access as well as pump water to fight a fire\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quinte; In fencing, the fifth fencer in parrying or attacking position.Category:en:Five\", \"priority\":5}]}, \"synonyms\":{}}");

	add("quinalbarbitone", "{\"term\":\"quinalbarbitone\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027quinque\u0027 ‘five’ + \u0027allyl\u0027 + \u0027barbitone\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sedative-hypnotic compound, 5-allyl-5-(1-methylbutyl)-barbituric acid, used to sedate patients before an operation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quince", "{\"term\":\"quince\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{borrowing|fro|cooing|lang\u003den}} (modern {{m|fr|coing}}), from {{m|la|cotōneum}}, from {{m|la|mālum cotōneum}}, a variant of {{m|la|mālum Cydonium||Cydonian apple}}, translating Ancient greek (to 1453) {{m|grc|μήλον κυδώνιον}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The pear-shaped fruit of a small tree of the rose family, \u0027Cydonia oblonga\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The deciduous tree bearing such fruit, native to Asia\", \"priority\":2}]}, \"synonyms\":{}}");

	add("quinine", "{\"term\":\"quinine\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Spanish\", \"Quechua\"], \"text\":\"From Spanish \u0027quina\u0027 (cinchona bark) from Quechua \u0027kina\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bitter colourless powder, an alkaloid derived from cinchona bark, used to treat malaria and as an ingredient of tonic water\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d“Piracy”: A Romantic Chronicle of These chapter\u003d2/9/1|url\u003dhttp://openlibrary.org/works/OL1519647W|passage\u003dHe hadn\u0027t the faintest idea what to with a cold in the head, he just took \u0027\u0027quinine\u0027\u0027 and continued to blow his nose\", \"priority\":2}]}, \"synonyms\":{}}");

	add("quinoa", "{\"term\":\"quinoa\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"Quechua\"], \"text\":\"From Spanish \u0027quinua\u0027 from Quechua \u0027kinwa\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A goosefoot, native to the Andes and cultivated for its edible seeds\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Derek B. Munro, Ernest Small, \u0027Vegetables of Canada\u0027, [http://books.google.com.au/books?id\u003dz_yezcnaUHQC\u0026amp;pg\u003dPA142\u0026amp;dq\u003d%22quinoa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d19kIUdX9Eo3slAXAyYCYAw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quinoa%22\u0026amp;f\u003dfalse page 142\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Chenopodium quinoa\u0027 Will, (\u0027\u0027quinoa\u0027\u0027) is native to the Andes, and the seeds are a staple grain in parts of South America. The newly formed Canadian \u0027\u0027Quinoa\u0027\u0027 Association anticipated growing about 400 ha of \u0027\u0027quinoa\u0027\u0027 annually (Anonymous 1992e\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 October, Lisa Turner, \u0027Have fun exploring the land of unconventional grains\u0027, \u0027Better Nutrition\u0027, [http://books.google.com.au/books?id\u003dEQUAAAAAMBAJ\u0026amp;pg\u003dPA70\u0026amp;dq\u003d%22quinoa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZdMIUcGnJojylAX904CgDA\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quinoa%22\u0026amp;f\u003dfalse page 70\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Quinoa\u0027\u0027 was cultivated about 3,000 years ago in the Andes mountain region, and was the favored crop of the Incas, who used it as a sacred plant in rituals\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Chittaranjan Kole, \u0027Pulses, Sugar and Tuber Crops\u0027, [http://books.google.com.au/books?id\u003d_0DKZdQyHy8C\u0026amp;pg\u003dPA148\u0026amp;dq\u003d%22quinoa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZdMIUcGnJojylAX904CgDA\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quinoa%22\u0026amp;f\u003dfalse page 148\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The oldest archeological remains of domesticated \u0027\u0027quinoa\u0027\u0027 date to 5000 BC (Tapia 1979\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The high-protein dried fruits and seeds of this plant, used as a food staple and ground into flour\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Mark Bittman, \u0027How to Cook Everything Vegetarian: Simple Meatless Recipes for Great Food\u0027, [http://books.google.com.au/books?id\u003dgNAU05uZJ-MC\u0026amp;pg\u003dPA560\u0026amp;dq\u003d%22quinoa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZdMIUcGnJojylAX904CgDA\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quinoa%22\u0026amp;f\u003dfalse page 560\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Turn the heat up to medium-high, add the \u0027\u0027quinoa\u0027\u0027, and sprinkle with salt and pepper\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Jonny Bowden, \u0027The 150 Healthiest Foods on Earth\u0027, [http://books.google.com.au/books?id\u003d14ENix5RzMgC\u0026amp;pg\u003dPA78\u0026amp;dq\u003d%22quinoa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZdMIUcGnJojylAX904CgDA\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quinoa%22\u0026amp;f\u003dfalse page 78\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Quinoa\u0027\u0027 is another of those foods that keeps getting miscategorized—everyone thinks it′s a grain, everyone uses it like a grain, but it′s actually a seed\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Miriam Backes, \u0027Bob′s Red Mill Cookbook: Whole \u0026amp; Healthy Grains for Every Meal of the Day\u0027, [http://books.google.com.au/books?id\u003dGKEn5KwCE_EC\u0026amp;pg\u003dPA104\u0026amp;dq\u003d%22quinoa%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZdMIUcGnJojylAX904CgDA\u0026amp;redir_esc\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quinoa%22\u0026amp;f\u003dfalse page 104\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"To use \u0027\u0027quinoa\u0027\u0027 in a salad, spread it on a platter or baking sheet after cooking to allow it to cool and, more importantly, dry. Cooked \u0027\u0027quinoa\u0027\u0027 can be stored in an airtight container in the refrigerator for up to 5 days\", \"priority\":20}]}, \"synonyms\":{}}");

	add("quinolone", "{\"term\":\"quinolone\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"Formed as {{suffix|quinoline|alt1\u003dquinol(ine)|one|lang\u003den}}, after the German \u0027chinolon\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several isomeric ketones derived from quinoline\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of a range of broad-spectrum antibiotics, related to nalidixic acid, based on this structure\", \"priority\":2}]}, \"synonyms\":{}}");

	add("quinquesyllable", "{\"term\":\"quinquesyllable\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|quinque|syllable|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word of five syllables\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quinsy", "{\"term\":\"quinsy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) \u0027quinencie\u0027 from \u0027quinancia\u0027 from Ancient greek (to 1453) \u0027κυνάγχη\u0027 (canine quinsy) from \u0027κύων\u0027 (dog) + \u0027ἄγχω\u0027 (throttle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A painful pus-filled inflammation or abscess of the tonsils and surrounding tissues, usually a complication of tonsillitis, caused by bacterial infection and often accompanied by fever\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027, w:Arthur Conan Arthur Conan Doyle, \u0027w:A Case Of A Case Of Identity\u0027, in \u0027The Adventures of Sherlock Holmes\u0027, 2012, [https://books.google.com.au/books?id\u003dJqMRBAAAQBAJ\u0026amp;pg\u003dPA43\u0026amp;dq\u003d%22quinsy+and+swollen+glands+when+he+was+young,+he+told+me,+and+it+had+left+him+with+a+weak+throat%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ved\u003d0CCcQ6AEwAmoVChMIw6Kf3p6HxwIVAyumCh2AEAs\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quinsy%20and%20swollen%20glands%20when%20he%20was%20young%2C%20he%20told%20me%2C%20and%20it%20had%20left%20him%20with%20a%20weak%20throat%22\u0026amp;f\u003dfalse page 43\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He\u0027d had the \u0027\u0027quinsy\u0027\u0027 and swollen glands when he was young, he told me, and it had left him with a weak throat, and a hesitating, whispering fashion of speech\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Gurdeep Singh Mannu, Tunde Odutoye, \u0027ENT MCQs for Medical Students: With Explanatory Answers\u0027, [https://books.google.com.au/books?id\u003dh416DZEyPUoC\u0026amp;pg\u003dPA130\u0026amp;dq\u003d%22quinsies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quinsies%22\u0026amp;f\u003dfalse page 130\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"b \u0027\u0027False\u0027\u0027. \u0027\u0027Quinsies\u0027\u0027 are found at the back of the throat on either side of the uvula along the tonsils\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"c \u0027\u0027True\u0027\u0027. A \u0027\u0027quinsy\u0027\u0027 grows as it swells with pus. This space-occupying effect can push the uvula away from it towards the opposite side\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Kerryn Phelps, Craig Hassed, \u0027General Practice: The Integrative Approach\u0027, [https://books.google.com.au/books?id\u003dHPocqpgIrNcC\u0026amp;pg\u003dPA317\u0026amp;dq\u003d%22quinsy%22%7C%22quinsies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22quinsy%22%7C%22quinsies%22\u0026amp;f\u003dfalse page 317\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The patient may have cervical lymphadenopathy, trismus (moderate to severe increases suggestive of \u0027\u0027quinsy\u0027\u0027 in acute setting), erythema of tonsils, crypt debris in tonsils or purulence of tonsils\", \"priority\":11}]}, \"synonyms\":{\"list\":[{\"text\":\"squinance\", \"synonymQualifier\":\"OBSOLETE\"},{\"text\":\"squinancy\", \"synonymQualifier\":\"OBSOLETE\"},{\"text\":\"squinzey\", \"synonymQualifier\":\"OBSOLETE\"}]}}");

	add("quintain", "{\"term\":\"quintain\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027quintine\u0027 \u0027quinteine\u0027 Middle french (ca. 1400-1600) \u0027quintaine\u0027 probably from Latin \u0027quīntāna\u0027 (street separating fifth and sixth maniples in a roman camp) feminine form of \u0027quintanus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An object (generally a post or plank on a support) set up as a target to be tilted at in jousting, or otherwise used as target practice\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Thomas Penn, \u0027Winter King\u0027, Penguin 2012, p. 285\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the tiltyard, his companions felt the juddering impact of his sword-blows and saw the muscled precision of his archery and his tilting at the \u0027\u0027quintain\", \"priority\":3}]}, \"synonyms\":{}}");

	add("quintal", "{\"term\":\"quintal\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027quintal\u0027 Middle french (ca. 1400-1600) \u0027quintal\u0027 from \u0027quintale\u0027 from Arabic \u0027قِنْطَار\u0027 ultimately from Latin \u0027centenarius\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A measure of weight originally equal to a hundred pounds; later, a hundredweight\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Thomas Penn, \u0027Winter King\u0027, Penguin 2012, page 204\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In one import license alone, the merchant in question was instructed to bring in 13,000 \u0027\u0027quintals\u0027\u0027 of alum, which, snapped up by industries in England and the Low Countries, would yield the king a cool £8,666 13s 4d\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One hundred kilograms\", \"priority\":4}]}, \"synonyms\":{}}");

	add("quintation", "{\"term\":\"quintation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quintate|ion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The of one (of\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1946\u0027\u0027, Thomas Hamilton Ormsbee, \u0027The Story of American Furniture\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dfpWxAAAAIAAJ\u0026amp;q\u003d%2Bquintation\u0026amp;dq\u003d%2Bquintation\u0026amp;hl\u003den\u0026amp;ei\u003d4PIvTo3CBYSz8QPy0IRS\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDcQ6AEwAw page 161]\u0026lt;/span\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Perhaps the \u0027\u0027quintation\u0027\u0027 of slats came from the hands of the indentured Hollander\", \"priority\":3}]}, \"synonyms\":{}}");

	add("quintessence", "{\"term\":\"quintessence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\"], \"text\":\"Middle english (1100-1500) from Middle french (ca. 1400-1600) from \u0027quinta essentia\u0027 \u0026quot;fifth essence\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thing that is the most perfect example of its type; the most perfect embodiment of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A pure substance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The essence of a thing in its purest and most concentrated form\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The fifth alchemical element, or essence, after earth, air, fire, and wate\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A hypothetical form of dark energy postulated to explain observations of an accelerating universe\", \"priority\":5}]}, \"synonyms\":{}}");

	add("quintet", "{\"term\":\"quintet\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Italian\", \"Latin\"], \"text\":\"From Italian \u0027quintetto\u0027 diminutive of \u0027quinto\u0027 (fifth) itself from Latin \u0027quintus\u0027 related to \u0027quīnque\u0027 (five)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A composition (a type of chamber music) in five parts (typically each a singer or instrumentalist, sometimes several musicians\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A group of five musicians, fit to play such a piece of music togethe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any group of five members\", \"priority\":3}]}, \"synonyms\":{}}");

	add("quipu", "{\"term\":\"quipu\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Spanish\", \"Quechua\"], \"text\":\"From Spanish {{m|es|quipu}}, from Cusco-Collao Quechua \u0027khipu\u0027 (knot)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A recording device, used by the Incas, consisting of intricate knotted cords\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quirt", "{\"term\":\"quirt\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027cuerda\u0027 (cord) or Mexican Spanish \u0027cuarta\u0027 (whip)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rawhide whip plaited with two thongs of buffalo hide\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"about 1900\u0027\u0027, O. Henry, \u0027s:Hygeia at the Hygeia at the Solito\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He sprang into the saddle easily as a bird, got the \u0027\u0027quirt\u0027\u0027 from the horn, and gave his pony a slash with it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He paused a moment and flicked a sage-brush with his \u0027\u0027quirt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, \u0027The Understanding Heart\u0027, Chapter I\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"when the young man whirled his horse, “hazed” Jupiter in circles and belaboured him with a rawhide \u0027\u0027quirt\u0027\u0027, He ceased his cavortings\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, \u0027Don\u0027t Point That Thing at Me\u0027, Penguin (2001), page 96\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"She raised the handle of her beautiful \u0027\u0027quirt\u0027\u0027 to her eyes and scanned the Western horizon\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, \u0027The Crossing\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He rode his horse with the reins tied and he wore a pistol at his belt and a plain flatcrowned hat of a type no longer much seen in that country and he wore tooled boots to his knees and carried a \u0027\u0027quirt\", \"priority\":10}]}, \"synonyms\":{}}");

	add("quirkiness", "{\"term\":\"quirkiness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quirky|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being quirk\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Your \u0027\u0027quirkiness\u0027\u0027 is so endearing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A specific quirky aspect of a person or thin\", \"priority\":3}]}, \"synonyms\":{}}");

	add("quirkyalone", "{\"term\":\"quirkyalone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|quirky|alone|lang\u003den}}; coined in the year 2000 by \u0027To-Do List\u0027 magazine publisher w:Sasha Cagen|Sasha Cagen in a magazine article in \u0027Utne Reader\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who enjoys being single (but is not opposed to being in a relationship) and generally prefers to be alone rather than dating for the sake of being in a couple\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quism", "{\"term\":\"quism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Contraction of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A quasi-isomorphism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, Jan R, Strooker, \u0027Homological Questions in Local Algebra\u0027, Cambridge University Press, ISBN 9780521315265, [http://books.google.com/books?id\u003dnA44AAAAIAAJ\u0026amp;pg\u003dPA5\u0026amp;dq\u003dquism page 5\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Most authors speak of a quasi-isomorphism or \u0027\u0027quism\u0027\u0027, but Bourbaki\u0027s term \u0026lt;!-- [\u003d]--\u0026gt;is more descriptive\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Kathryn P. Hess, “Twisted tensor products of DGA’s and the Adams-Hilton model for the total space of a fibration”, in Nigel Ray and Spike Walker (editors), \u0027Adams Memorial Symposium on Algebraic Topology\u0027 (proceedings of a July 1990 symposium), Volume I, Cambridge University Press, ISBN 978-0-521-42074-7, [http://books.google.com/books?id\u003dsh5QCJa-MlIC\u0026amp;pg\u003dPA51\u0026amp;dq\u003dquism page 51\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Then the composition is a \u0027\u0027quism\u0027\u0027 and therefore is an acceptable Adams-Hilton model for E\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Alex Martsinkofsky, New homological invariants for modules over local rings, II, \u0027Journal of Pure and Applied Algebra\u0027, Vol. 153 No. 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"By [3], the vertical maps are \u0027\u0027quisms\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Martin Markl, Steven Shnider, James Stasheff, \u0027Operads in Algebra, Topology and Physics\u0027, American Mathematical Society, ISBN 978-0-8218-2134-3, [http://books.google.com/books?id\u003dfMhZjT9lQo0C\u0026amp;pg\u003dPA201\u0026amp;dq\u003dquism page 201\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Since \u0027ρ\u0027₀ is a surjective \u0027\u0027quism\u0027\u0027, the Σ-module \u0027K\u0027 is acyclic\", \"priority\":9}]}, \"synonyms\":{}}");

	add("quitrent", "{\"term\":\"quitrent\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|quit|rent|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rent reserved in grants of land, by the payment of which the tenant is quit (absolved) from other service\", \"priority\":1}]}, \"synonyms\":{}}");

	add("quiverful", "{\"term\":\"quiverful\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quiver|ful|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The amount held by a quive\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large amount\", \"priority\":2}]}, \"synonyms\":{}}");

	add("quixote", "{\"term\":\"quixote\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"After \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone resembling Don Quixote; someone who is chivalrous but unrealistic; an idealist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1723\u0027\u0027, Charles Walker, \u0027Sally Salisbury\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I had once determined to fix the terrible Name of some \u0027Man\u0027 of \u0027War\u0027 in the Front of \u0027your History\u0027, a \u0027perfect Hero\u0027, that should like another \u0027\u0027\u0027\u0027 defend your \u0027Reputation\u0027 right, or wrong\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, \u0027Transitional Poem\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Few things can more inflame / This far too combative heart / Than the intellectual \u0027\u0027Quixotes\u0027\u0027 of the age / Prattling of abstract art\", \"priority\":5}]}, \"synonyms\":{}}");

	add("quixotism", "{\"term\":\"quixotism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That form of delusion which leads to extravagant and absurd undertakings or sacrifices in obedience to a morbidly romantic ideal of duty or honor, as illustrated by the exploits of Don Quixote in knight-errantry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Quixotry\", \"priority\":2}]}, \"synonyms\":{}}");

	add("quizzer", "{\"term\":\"quizzer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|quiz|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who quizzes or asks questions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who takes part in a quiz\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who chaffs or mocks\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Margracia Loudon, \u0027First Love\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Meanwhile, the whirl of gaiety, the noise of merriment, was still going on around them. Frances was the ringleader of the \u0027\u0027quizzers\u0027\u0027 of Lady Susan, and her ladyship evidently liked being quizzed, so that Frances did not think mercy necessary\", \"priority\":5}]}, \"synonyms\":{}}");

